package rrhh;public class Medico extends Empleado{	private String cedula;	private String especialidad;	public Medico(){}	public Medico(String cedula, String especialidad){		this.cedula = cedula;		this.especialidad = especialidad;	}	public void setCedula(String cedula){		this.cedula = cedula;	}	public String getCedula(){		return cedula;	}	public void setEspecialidad(String especialidad){		this.especialidad = especialidad;	}	public String getEspecialidad(){		return especialidad;	}	public String toString(){		return super.toString() + ", c√©dula: " + cedula + ", especialidad: " + especialidad;	}}